import React, {useState} from 'react';
import {createMuiTheme, createStyles, makeStyles, Theme, ThemeProvider} from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Summary from "../AccountSummary/summary";
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';
import {Collapse, Icon, Link} from "@material-ui/core";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from "../Home/Home";
import data from "../../store/data"

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#5ee279',
            main: '#1aaf4b',
            dark: '#007e1d',
            contrastText: '#fff',
        },
        secondary: {
            main: '#1bb14c',
        },
    },
});
const drawerWidth = 270;

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            display: 'flex',
            minHeight: '800px'
        },
        appBar: {
            zIndex: theme.zIndex.drawer + 1,
        },
        drawer: {
            width: drawerWidth,
            flexShrink: 0,
        },
        drawerPaper: {
            width: drawerWidth,
        },
        content: {
            flexGrow: 1,
            padding: theme.spacing(3),
        },
        toolbar: theme.mixins.toolbar,
        nested: {
            paddingLeft: theme.spacing(4),
        },
    }),
);

export default function ClippedDrawer() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <ThemeProvider theme={theme}>
                <CssBaseline/>
                <Router>
                <AppBar
                    position="fixed"
                    className={classes.appBar}
                >
                    <Toolbar>
                        <Typography variant="h6" noWrap>
                            DV Bank
                        </Typography>
                    </Toolbar>
                </AppBar>
                <Drawer
                    className={classes.drawer}
                    variant="permanent"
                    classes={{
                        paper: classes.drawerPaper,
                    }}
                >
                    <div className={classes.toolbar}/>
                    {data.menus.map(menu => {
                        return (
                            <div>
                                <List>
                                    <ListItem button >
                                        <ListItemIcon>
                                            <Icon>{menu.icon}/</Icon>
                                        </ListItemIcon>
                                        <ListItemText primary={menu.title}/>
                                        {(menu.items.length > 0 )? (`menu${menu.id}` ? <ExpandLess/> : <ExpandMore/>):''}
                                    </ListItem>
                                    {(menu.items.length > 0) ?
                                        (
                                            menu.items.map(item=>{
                                                return (
                                                    <Collapse in={menu.open} timeout="auto" unmountOnExit>
                                                        <List component="div" disablePadding>
                                                            <ListItem button className={classes.nested}>
                                                                <ListItemText primary={item.title}/>
                                                            </ListItem>
                                                        </List>
                                                    </Collapse>
                                                )
                                            })
                                        ):''}
                                </List>
                                {(menu.title==='Home')?(<Divider/>):''}
                            </div>
                        )
                    })}
                </Drawer>
                <main className={classes.content}>
                    <div className={classes.toolbar}/>
                    <Switch>
                        <Route path="/summary">
                            <Summary/>
                        </Route>
                        <Route path="/home">
                            <Home/>
                        </Route>
                    </Switch>

                </main>
                </Router>
            </ThemeProvider>
        </div>
    );
}
